import React,{useHis} from 'react'
import { useHistory } from "react-router-dom"

const Error = () => {
    history = useHistory()
    return (
        <div>
            <h1>404 Page not Fount</h1>
            <button onClick={ ()=> {history.push("/")}  }>GoBack</button>
        </div>
    )
}

export default Error
